// ==UserScript==
// @name         Grok Aurora Getter Backerer: Kinda Edition
// @namespace    http://tampermonkey.net/
// @version      5.0
// @description  Auto-injects blank PNG images for Aurora editing with UI controls
// @author       Grok
// @match        https://grok.com/*
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/553817/Grok%20Aurora%20Getter%20Backerer%3A%20Kinda%20Edition.user.js
// @updateURL https://update.greasyfork.org/scripts/553817/Grok%20Aurora%20Getter%20Backerer%3A%20Kinda%20Edition.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Blank PNG base64 options (raw, no prefix)
    const blankPngPortrait = ''; // Paste raw base64 for portrait (1440x2560) from base64(1).txt "data"
    const blankPngLandscape = ''; // Paste raw base64 for landscape (2560x1440) from base64(2).txt "data"
    const blankPngSquare = ''; // Paste raw base64 for square (2560x2560) from base64.txt "data"

    // Caching per type
    const CACHE_KEYS = {
        portrait: 'grok_aurora_file_id_portrait',
        landscape: 'grok_aurora_file_id_landscape',
        square: 'grok_aurora_file_id_square'
    };
    const CACHE_EXPIRY = 30 * 60 * 1000; // 30 minutes

    // Color palette
    const COLORS = {
        bgMain: '#0f0f0f',
        border: '#262626',
        elementBg: '#1c1c1c',
        textPrimary: '#f9f8f6',
        textShade: '#9c9c9b',
        textDark: '#474646'
    };

    function getCachedFileId(type) {
        const cached = localStorage.getItem(CACHE_KEYS[type]);
        if (cached) {
            const { id, timestamp } = JSON.parse(cached);
            if (Date.now() - timestamp < CACHE_EXPIRY) {
                console.log(`Using cached ${type} file ID:`, id);
                return id;
            }
        }
        return null;
    }

    function cacheFileId(type, id) {
        const data = { id, timestamp: Date.now() };
        localStorage.setItem(CACHE_KEYS[type], JSON.stringify(data));
        console.log(`Cached ${type} file ID:`, id);
    }

    let commonHeaders = {};

    function generateUuid() {
        return crypto.randomUUID();
    }

    async function uploadBlankPNG(type) {
        let base64;
        switch (type) {
            case 'portrait':
                base64 = blankPngPortrait;
                break;
            case 'landscape':
                base64 = blankPngLandscape;
                break;
            default:
                base64 = blankPngSquare;
        }
        if (!base64) {
            console.error(`No base64 for ${type}`);
            return null;
        }
        console.log(`Starting ${type} blank PNG upload`);
        const uploadHeaders = {
            'Content-Type': 'application/json',
            'x-xai-request-id': generateUuid(),
            ...commonHeaders
        };
        try {
            const response = await fetch('https://grok.com/rest/app-chat/upload-file', {
                method: 'POST',
                headers: uploadHeaders,
                body: JSON.stringify({
                    fileName: `blank_${type}.png`,
                    fileMimeType: 'image/png',
                    content: base64
                })
            });
            if (!response.ok) throw new Error(`Upload failed: ${response.status}`);
            const result = await response.json();
            const fileId = result.fileMetadataId;
            console.log(`Upload success, ${type} file ID:`, fileId);
            cacheFileId(type, fileId);
            return fileId;
        } catch (error) {
            console.error(`Upload error for ${type}:`, error);
            try {
                const response = await fetch('https://grok.com/rest/app-chat/upload-file', {
                    method: 'POST',
                    headers: uploadHeaders,
                    body: JSON.stringify({
                        fileName: `blank_${type}.png`,
                        fileMimeType: 'image/png',
                        content: base64
                    })
                });
                const result = await response.json();
                const fileId = result.fileMetadataId;
                cacheFileId(type, fileId);
                return fileId;
            } catch (retryError) {
                console.error(`Retry failed for ${type}:`, retryError);
                return null;
            }
        }
    }

    let enableInjection = true;
    let selectedType = 'square';

    function addUI() {
        const container = document.createElement('div');
        container.style.position = 'fixed';
        container.style.bottom = '20px';
        container.style.right = '20px';
        container.style.zIndex = '9999';
        container.style.backgroundColor = COLORS.bgMain;
        container.style.border = `1px solid ${COLORS.border}`;
        container.style.borderRadius = '12px';
        container.style.padding = '16px';
        container.style.boxShadow = '0 20px 25px -5px rgba(0, 0, 0, 0.5)';
        container.style.display = 'flex';
        container.style.flexDirection = 'column';
        container.style.gap = '12px';
        container.style.fontFamily = '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif';
        container.style.minWidth = '200px';

        // Toggle button
        const toggleBtn = document.createElement('button');
        const updateToggle = () => {
            toggleBtn.textContent = enableInjection ? ' Image Injector: ON' : ' Image Injector: OFF';
            toggleBtn.style.backgroundColor = enableInjection ? COLORS.elementBg : COLORS.elementBg;
            toggleBtn.style.color = enableInjection ? '#4ade80' : '#ef4444';
        };
        updateToggle();
        toggleBtn.style.border = `1px solid ${COLORS.border}`;
        toggleBtn.style.padding = '12px 14px';
        toggleBtn.style.borderRadius = '8px';
        toggleBtn.style.cursor = 'pointer';
        toggleBtn.style.fontSize = '14px';
        toggleBtn.style.fontWeight = '600';
        toggleBtn.style.transition = 'all 0.2s ease';
        toggleBtn.style.textShadow = `0 1px 2px ${COLORS.textDark}`;
        toggleBtn.onmouseover = () => {
            toggleBtn.style.backgroundColor = COLORS.border;
        };
        toggleBtn.onmouseout = () => {
            toggleBtn.style.backgroundColor = COLORS.elementBg;
        };
        toggleBtn.onclick = () => {
            enableInjection = !enableInjection;
            updateToggle();
            console.log(`Injection toggled to ${enableInjection ? 'ON' : 'OFF'}`);
        };
        container.appendChild(toggleBtn);

        // Divider
        const divider = document.createElement('div');
        divider.style.height = '1px';
        divider.style.backgroundColor = COLORS.border;
        divider.style.margin = '4px 0';
        container.appendChild(divider);

        // Aspect label
        const label = document.createElement('div');
        label.textContent = 'Image Aspect:';
        label.style.color = COLORS.textPrimary;
        label.style.fontSize = '12px';
        label.style.fontWeight = '600';
        label.style.letterSpacing = '0.5px';
        label.style.textTransform = 'uppercase';
        label.style.textShadow = `0 1px 2px ${COLORS.textDark}`;
        container.appendChild(label);

        // Aspect buttons container
        const aspectContainer = document.createElement('div');
        aspectContainer.style.display = 'flex';
        aspectContainer.style.flexDirection = 'column';
        aspectContainer.style.gap = '8px';

        const aspects = ['portrait', 'landscape', 'square'];
        aspects.forEach(aspect => {
            const btn = document.createElement('button');
            const displayName = aspect.charAt(0).toUpperCase() + aspect.slice(1);
            btn.textContent = ` ${displayName}`;
            btn.style.backgroundColor = selectedType === aspect ? COLORS.border : COLORS.elementBg;
            btn.style.color = selectedType === aspect ? COLORS.textPrimary : COLORS.textShade;
            btn.style.border = `1px solid ${COLORS.border}`;
            btn.style.padding = '10px 12px';
            btn.style.borderRadius = '6px';
            btn.style.cursor = 'pointer';
            btn.style.fontSize = '13px';
            btn.style.fontWeight = '500';
            btn.style.transition = 'all 0.2s ease';
            btn.style.textAlign = 'left';
            btn.onmouseover = () => {
                btn.style.backgroundColor = COLORS.border;
                btn.style.color = COLORS.textPrimary;
            };
            btn.onmouseout = () => {
                btn.style.backgroundColor = selectedType === aspect ? COLORS.border : COLORS.elementBg;
                btn.style.color = selectedType === aspect ? COLORS.textPrimary : COLORS.textShade;
            };
            btn.onclick = () => {
                selectedType = aspect;
                aspects.forEach(a => {
                    const btns = aspectContainer.querySelectorAll('button');
                    btns.forEach(b => {
                        if (b.textContent.includes(a.charAt(0).toUpperCase() + a.slice(1))) {
                            b.style.backgroundColor = a === aspect ? COLORS.border : COLORS.elementBg;
                            b.style.color = a === aspect ? COLORS.textPrimary : COLORS.textShade;
                        }
                    });
                });
                console.log(`Selected aspect: ${aspect}`);
            };
            aspectContainer.appendChild(btn);
        });

        container.appendChild(aspectContainer);
        document.body.appendChild(container);
        console.log('UI added');
    }

    const originalFetch = window.fetch;
    window.fetch = async function(url, options) {
        console.log('Intercepted fetch:', url);

        if (options && options.headers) {
            Object.assign(commonHeaders, options.headers);
        }

        if (enableInjection && (url.includes('/conversations/new') || url.includes('/responses'))) {
            if (options && options.body) {
                let body;
                try {
                    body = JSON.parse(options.body);
                } catch (e) {
                    console.error('Failed to parse body:', e);
                }

                if (body && body.enableImageGeneration && (!body.fileAttachments || body.fileAttachments.length === 0)) {
                    console.log('Injecting image attachment and edit message');

                    let type = selectedType;
                    const lowerMessage = body.message.toLowerCase();
                    if (type === 'square' && (lowerMessage.includes('portrait') || lowerMessage.includes('vertical'))) {
                        type = 'portrait';
                    } else if (type === 'square' && (lowerMessage.includes('landscape') || lowerMessage.includes('horizontal'))) {
                        type = 'landscape';
                    }
                    console.log(`Selected blank type: ${type}`);

                    let fileId = getCachedFileId(type);
                    if (!fileId) {
                        fileId = await uploadBlankPNG(type);
                    }
                    if (fileId) {
                        body.fileAttachments = [fileId];
                        if (!lowerMessage.includes('edit') && !lowerMessage.includes('modify') && !lowerMessage.includes('change')) {
                            body.message = `Edit this image to show: ${body.message}`;
                        }
                        options.body = JSON.stringify(body);
                        console.log('Injected and modified body:', options.body);
                    }
                }
            }
        }

        return originalFetch(url, options);
    };

    addUI();
})();